import React from 'react';
import ImageGallery from 'react-image-gallery';

const images = [
    {
        original: require('../Images/IMG_4224.jpg'),
        thumbnail: require('../Images/IMG_4224.jpg'),
    },
    {
        original: require('../Images/IMG_4230.jpg'),
        thumbnail: require('../Images/IMG_4230.jpg'),
    },
    {
        original: require('../Images/IMG_4255.jpg'),
        thumbnail: require('../Images/IMG_4255.jpg'),
    },
    {
        original: require('../Images/IMG_4289.jpg'),
        thumbnail: require('../Images/IMG_4289.jpg'),
    },
    {
        original: require('../Images/IMG_4264.jpg'),
        thumbnail: require('../Images/IMG_4264.jpg'),
    },
    {
        original: require('../Images/IMG_4287-2.jpg'),
        thumbnail: require('../Images/IMG_4287-2.jpg'),
    },
]
function Image() {

    return(
        <>
        <ImageGallery 
        items= {images}/>
        </>
    );
}

export default Image
